#include <bits/stdc++.h>
using namespace std;

void solution1() {
	int n;
	cin >> n;
	int a[n];
	for (auto &i : a) {
		cin >> i;
	}
	int ans = 0;
	for (int i = 0; i < n; i++) {
		for (int j = i; j < n; j++) {
			int puni = 0;
			for (int k = i; k <= j; k++) {
				puni ^= a[k];
			}
			if (puni == 0) {
				ans++;
			}
		}
	}
	cout << ans << endl;
}

void solution2() {
	int n;
	cin >> n;
	int a[n];
	for (auto &i : a) {
		cin >> i;
	}
	int dp[n + 1]{};
	for (int i = 0; i < n; i++) {
		dp[i + 1] = dp[i] ^ a[i];
	}
	int ans = 0;
	for (int i = 0; i < n + 1; i++) {
		for (int j = i + 1; j < n + 1; j++) {
			if ((dp[i] ^ dp[j]) == 0) {
				ans++;
			}
		}
	}
	cout << ans << endl;
}

int main() {
	solution1();
	//solution2();
	return 0;
}
